import React from 'react';
import { useHistory } from 'react-router-dom';
import Footer from '../../components/footer/Footer';
import Header from '../../components/header/Header';
import fetchAPI from '../../services/fetchAPI';

function ExploreFoodsIng() {
  const history = useHistory();

  const renderFoodsByIngredients = async () => {
    const promise = await fetch('https://www.themealdb.com/api/json/v1/1/filter.php?i');
    const myObj = await promise.json();
    const id = myObj.meals[0].idMeal;
    history.push('/Foods');
    console.log(id);
  };

  return (
    <div>
      <Header
        label="Explore Ingredients"
        testid="page-title"
      />
      <button
        type="button"
        onClick={ () => {
          renderFoodsByIngredients();
        } }
      >
        <div
          data-testid={ `${1}-ingredient-card` }
        >
          <h2
            data-testid={ `${1}-card-name` }
          >
            Card
          </h2>
        </div>
      </button>
      <Footer />
    </div>
  );
}

export default ExploreFoodsIng;
